import React, { useEffect, useState } from "react";
import "../Home.css";

export default function Home(props) {
  const userUid = localStorage.getItem("userUid");

  const [totalStudentsHave, setTotalStudentsHave] = useState("");
  const [takeList, setTake] = useState([]);
  console.log(takeList);
  useEffect(() => {
    props.user.forEach((item) => {
      if (item.uid === userUid) {
        setTotalStudentsHave(item.totalStudents);
      }
    });
  }, "");

  let list = null; ////////////////////////////////////

  const [students, setStudent] = useState([]);

  useEffect(() => {
    fetch("/student")
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        setStudent(data.student);
      });
  }, []);

  async function Handler1() {
    const res = await fetch("http://localhost:5000/updateStudentCountTeacher", {
      method: "POST",
      mode: "cors",
      body: JSON.stringify({ uid: userUid }),
      headers: {
        "Content-Type": "application/json",
      },
    });

    if (res.status === 201) {
      const val = await res.json();
      setTotalStudentsHave(val.toStu);
      console.log(totalStudentsHave);
    }
  }

  async function Handler2(name) {
    const res = await fetch("http://localhost:5000/addStudentToTeacher", {
      method: "POST",
      mode: "cors",
      body: JSON.stringify({ uid: userUid, stuName: name }),
      headers: {
        "Content-Type": "application/json",
      },
    });

    if (res.status === 200) {
      const val = await res.json();
      console.log(val);
      Handler4(name);
    }
  }

  async function Handler4(name) {
    const res = await fetch("http://localhost:5000/setStudentList", {
      method: "POST",
      mode: "cors",
      body: JSON.stringify({ uid: userUid, name: name }),
      headers: {
        "Content-Type": "application/json",
      },
    });

    if (res.status === 200) {
      const val = await res.json();
      console.log(val);
    }
  }

  async function Handler3() {
    console.log("Hello");
    const res = await fetch("http://localhost:5000/returnStudentList", {
      method: "POST",
      mode: "cors",
      body: JSON.stringify({ uid: userUid }),
      headers: {
        "Content-Type": "application/json",
      },
    });
    let val;
    if (res.status === 200) {
      val = await res.json();
      setTake(val);
    }
  }

  async function Handler(name) {
    console.log("Hello");
    const res = await fetch("http://localhost:5000/updateStudent", {
      method: "POST",
      mode: "cors",
      body: JSON.stringify({ name: name }),
      headers: {
        "Content-Type": "application/json",
      },
    });
    if (res.status === 200) {
      const val = await res.json();
      setStudent(val.student);
    }
  }

  return (
    <div>
      <div id="div1">
        <p id="noStudentP">All students are assigned</p>
        <div id="grid">
          {students.map((value, index) => {
            if (value.assigned == 0) {
              document.getElementById("noStudentP").style.display = "none";
              return (
                <div className="gridDiv">
                  <p className="nameP">{value.name}</p>
                  <button
                    onClick={() => {
                      console.log(totalStudentsHave, ", inside Btn");
                      if (parseInt(totalStudentsHave) < 4) {
                        Handler(value.name);
                        Handler1();
                        Handler2(value.name);
                      } else {
                        alert("Can't add more");
                      }
                    }}
                  >
                    Take
                  </button>
                </div>
              );
            }
          })}
        </div>
      </div>

      <div id="div2">
        <div>
          <button
            onClick={() => {
              Handler3();
            }}
          >
            Update
          </button>
          <div id="grid">
            {Object.keys(takeList).length > 0 ? (
              <div>
                {Object.keys(takeList).map((keys) => {
                  return (
                    <div className="gridDiv">
                      <p className="nameP">{takeList[`${keys}`]}</p>
                    </div>
                  );
                })}
              </div>
            ) : (
              <p>Click on update to update</p>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}
